INSERT INTO `dochoi` (`ID`, `TenDoChoi`, `HinhAnh`, `MoTa`, `GiaBan`, `NgayTiepNhan`, `SoLuotXem`, `SoLuongBan`, `IDLoaiDoChoi`, `IDNhaSanXuat`, `IDXuatXu`) VALUES
(61, 'Đồ chơi đàn ghita 168-11', 'do-choi/Do-choi-dan-ghita.jpg', 'Chất liệu nhựa an toàn\r\nDành cho bé trên 3 tuổi\r\nNhiều giai điệu\r\nĐồ chơi đàn ghita 168-11 có hình thù của một chú hươu cao cổ ngộ nghĩnh. \r\n\r\nVới những nút chuyển giai điệu mang hình thú, bé có thể thay đổi các thể loại nhạc khác nhau. Kèm theo đó, mỗi khi bé nhấn các nút để sáng tác giai điệu, đôi mắt của hươu cao cổ sẽ phát ra những tia sáng thu hút bé.\r\n\r\nChiếc đàn có thể mang lại cho trẻ niềm thích thú với âm nhạc. Trẻ có thể sáng tác những giai điệu vui nhộn hay có thể thử làm một tay ghita điêu luyện', 50000, '2013-06-04 21:04:49', 70, 48, 18, 31, 13),
(63, 'Đồ chơi kèn trompet 3232', 'do-choi/9b9b0_do-choi-ken-trompet.jpg', 'Phát âm thanh\r\nXinh xắn, đáng yêu\r\nChất liệu an toàn\r\nĐồ chơi kèn trompet 3232 là sản phẩm an toàn dành cho bé từ 6 tháng tuổi trở lên.\r\n\r\nMàu sắc đa dạng giúp bé làm quen và nhận biết màu sắc khi còn nhỏ\r\n\r\nPhát ra âm thanh khi bé thổi.\r\n\r\nĐồ chơi kèn trompet 323 mang thương hiệu Toyroyal - Nhật Bản.\r\n\r\nSản xuất tại Trung Quốc.', 58000, '2013-06-04 21:09:03', 21, 9, 18, 29, 2),
(64, 'Đồ chơi kèn hình chai sữa 3325', 'do-choi/ken-hinh-chai-sua-3325.jpg', 'Sản phẩm an toàn\r\nThiết kế ngộ nghĩnh\r\nCó âm thanh khi thổi\r\nĐồ chơi kèn hình chai sữa 3325 là sản phẩm an toàn dành cho bé từ 6 tháng tuổi trở lên.\r\n\r\nThiết kế chai sữa đa màu sắc rất ngộ nghĩnh và đáng yêu.\r\n\r\nMàu sắc đa dạng giúp bé làm quen và nhận biết màu sắc khi còn nhỏ\r\n\r\nPhát ra âm thanh khi bé thổi\r\n\r\nĐồ chơi kèn hình chai sữa 3325 mang thương hiệu Toyroyal - Nhật Bản.\r\n\r\nSản xuất tại Trung Quốc.', 98000, '2013-06-04 21:10:26', 12, 12, 18, 33, 2),
(66, 'Đồ chơi Angry Birds SB016', 'do-choi/do-choi-Angri-birds-SB016-5.jpg', 'Chất liệu nhựa cao cấp\r\nMàu sắc đa dạng\r\nDành cho bé từ 3 tuổi trở lên', 105000, '2013-06-04 21:20:22', 13, 3, 18, 35, 2),
(67, 'Đồ chơi xếp hình Fisher Price', 'do-choi/Do-choi-xep-hinh-fisher-price-w3112-1.jpg', 'ĐẶC ĐIỂM NỔI BẬT\r\n\r\n- Đồ chơi xếp hình Fisher Price W3112  là bộ xếp hình nhằm tăng cường kỹ năng vận động và phối hợp tay - mắt.\r\n', 275000, '2013-06-04 21:31:39', 29, 10, 19, 33, 2),
(68, 'Đồ chơi Roobot Dragon Force D9032 - Thần Giáp Xanh Lam Biến Hình', 'do-choi/sieu-ro-bot-than-giap-xanh-lam-bien-hinh243.jpg', '- Đồ chơi được làm từ chất liệu nhựa rất an toàn cho sức khỏe của trẻ nhỏ.\r\n\r\n- Đồ chơi được mô phỏng theo hình dạng chính xác như nhân vật trong phim hoạt hình "Biệt Đội Thép".\r\n- Có thể cử động tay chân, cầm vũ khí và lắp ráp cho bé cảm giác thích thú khi chơi.\r\n\r\n- Đồ chơi nhập vai vừa khuyến khích trẻ vận động tay chân, vừa kích thích trí sáng tạo, phát triển đầy đủ thể chất và đặc biệt là tinh thần chính nghĩa.', 750000, '2013-06-04 21:34:29', 10, 5, 19, 59, 19),
(93, 'Búp bê mùa đông ( bé )', 'do-choi/Bup-be-mua-dong-be.jpg', 'Cho bé từ 3 tuổi trở lên\r\nHình ảnh, màu sắc sinh động\r\nPhát triển tư duy cho bé', 44000, '2013-06-07 20:46:01', 3, 0, 28, 57, 7),
(94, 'Bộ búp bê bướm 836338 - 4', 'do-choi/Bup-be-buom-836338-4.jpg', 'Phát triển thị giác\r\nPhát triển xúc giác\r\nCho bé gái từ 3 tuổi trở lên', 79000, '2013-06-07 20:47:41', 0, 0, 28, 32, 2),
(95, 'Đồ chơi búp bê phi công 89989', 'do-choi/bup-be-phi-cong-89989.jpg.jpg', 'Đồ chơi búp bê phi công 89989 có hộp đựng riêng với mặt cười đáng yêu. Chân, tay búp bê có thể cử động, di chuyển. Đồ chơi an toàn cho răng bé.\r\n\r\n- Xuất xứ: Hong Kong\r\n\r\n- Chất liệu: Nhựa\r\n\r\n- Màu sắc: Màu xanh\r\n\r\n- Đặc điểm:\r\n\r\n+ Phát triển thị giác: Màu sắc sinh động, tươi sáng\r\n\r\n+ Phát triển thính giác: Ấn nút ở bụng búp bê để phát ra âm thanh\r\n\r\n+ Phát triển xúc giác: Thiết kế bề mặt nhẵn, không gây xước, đảm bảo an toàn tuyệt đối cho bé khi chơi\r\n\r\n+ Phát triển kĩ năng vận động: Đồ chơi nhỏ gọn, dễ cầm nắm\r\n\r\n+ Phát triển trí tuệ: Giúp bé có nhận thức ban đầu về thế giới xung quanh\r\n\r\n- Độ tuổi: dành cho bé từ 1 - 5 tuổi', 125000, '2013-06-07 20:49:16', 0, 0, 28, 40, 2),
(96, 'ĐỒ CHƠI BÚP BÊ GANG NAM STYLE D6605', 'do-choi/Gang-nam-style-D6605.jpg', 'Búp bê hình nhân vật hát Gangnam style\r\nCó điệu Gangnam style vui nhộn\r\nCho bé gái từ 3 tuổi trở lên', 169000, '2013-06-07 20:50:34', 0, 0, 28, 49, 2),
(97, 'Bộ đồ chơi bác sỹ 093', 'do-choi/bo-do-choi-bac-sy-093.jpg', 'Dành cho bé từ 2 tuổi trở lên\r\nMàu sắc đa dạng\r\nLà đồ chơi tư duy cho bé', 115000, '2013-06-07 20:53:05', 3, 2, 22, 52, 1),
(98, 'ĐỒ CHƠI TẬP LÀM BÁC SĨ 9902', 'do-choi/do-choi-tap-lam-bac-si-1746.png', 'Chất liệu nhựa an toàn cho bé\r\nGồm đầy đủ các vật dụng y tế\r\nGiúp bé làm quen với các dụng cụ y tế', 95000, '2013-06-07 20:53:40', 3, 4, 22, 33, 3),
(99, 'GẤU TEDDY FISHER PRICE HỌC VÀ HÁT (FISHER-PRICE LEARN AND SING TEDDY)', 'do-choi/gau-teddy-vua-hoc-vua-choi-2.jpg', 'Có âm thanh hát vui nhộn\r\nGấu vừa học vừa hát\r\nCó thể ru bé ngủ mỗi tối', 560000, '2013-06-07 20:55:25', 4, 0, 26, 41, 8),
(100, 'Thú bông lò xo Thái Lan', 'do-choi/thu-bong-lo-xo-thai-lan-1.jpg', 'Chất liệu vải + xốp an toàn\r\nThiết kế đa dạng, ngộ nghĩnh\r\nNhập khẩu từ Thái Lan', 49000, '2013-06-07 20:56:13', 0, 0, 26, 54, 19),
(101, 'Thú sâu hạt L2', 'do-choi/thu-sau-hat-9.jpg', 'Chất liệu vải cotton an toàn\r\nHình thú ngộ nghĩnh\r\nMàu sắc sinh động', 65000, '2013-06-07 23:44:41', 0, 0, 26, 53, 23),
(102, 'Đồ chơi oto điều khiển LAMBORGHINI LP670-4', 'do-choi/oto-dieu-khien-38900-1.jpg', 'Đồ chơi ô tô Lamborghini LP670-4 mô hình xe hơi thiết kế mô phỏng cho dòng xe ô tô thể thao  sang trọng\r\n\r\nTần số vô tuyến không dây (RF) điều khiển\r\n\r\nĐược trang bị với một điều khiển từ xa 27 MHz\r\n\r\nDễ dàng để kiểm soát, điều khiển vô tuyến đầy đủ chức năng\r\n\r\nChức năng: phía trước, ngược lại, rẽ trái, rẽ phải\r\n\r\nKhi chuyển động đèn pha phía trước hoặc phía sau sẽ chuyển động \r\n\r\nChiếc xe mô hình được hỗ trợ bởi 5 x pin AA (pin không bao gồm)\r\n\r\nĐiều khiển từ xa được hỗ trợ bởi 1 x 9V pin (pin không bao gồm)\r\n\r\nHoàn hảo cho màn hình hiển thị của bộ sưu tập và cũng có thể được sử dụng như một món đồ chơi, quà tặng\r\n\r\nCho bé từ 4 tuổi trở lên\r\n\r\nMàu: VÀNG\r\n\r\nTổng trọng lượng: 1265g\r\n\r\nKích thước xe (dài x rộng x cao): 18 x 33 x 8 cm', 959000, '2013-06-07 23:50:59', 1, 5, 29, 40, 12),
(103, 'Đồ chơi oto điều khiển LAMBORGHINI 29000', 'do-choi/Do-choi-oto-dieu-khien-29000-7.jpg', 'Đồ chơi oto điều khiển từ xa Lamborghini 29000 là một mô hình siêu xe, thu nhỏ tại, cho phép bạn sở hữu một chiếc Lamborghini đích thực mà không có giá đắt. Với chi tiết và làm việc tuyệt vời đèn xe này điều khiển từ xa là phải có cho tất cả các fan của Lamborghini.\r\n\r\nĐặc điểm nổi bật\r\n\r\nTính năng: Authentic Lamborghini xe điều khiển từ xa, xe Authentic stying với cơ thể đúc phun, hệ thống treo độc lập.\r\n\r\nXe: Lamborgnihi\r\n\r\nMô hình: điều khiển từ xa RC Lamborghini vàng RS 29000\r\n\r\nMàu sắc: da cam\r\n\r\nĐầy đủ chức năng Radio Control: Chuyển tiếp, ngược, trái và phải.\r\n\r\nThương hiệu: RAstar\r\n\r\nTuổi: 6 +\r\n\r\nTrọng lượng: 130g ròng (bao gồm cả hộp hiển thị)\r\n\r\nSau khi đóng gói [+ trọng lượng điều khiển từ xa]: Khoảng. 225g', 369000, '2013-06-07 23:52:35', 3, 5, 29, 40, 12),
(104, 'Đồ chơi trẻ em mô hình Ngũ Hành Vương', 'do-choi/Do-choi-tre-em-mo-hinh-ngu-hanh-vuong-3.jpg', 'Đồ chơi trẻ em mô hình Ngũ Hành Vương được làm từ chất liệu nhựa và kim loại an toàn không ảnh hưởng đến sức khỏe của bé.\r\n\r\nBộ sản phẩm bao gồm: 01 mô hình nhân vật và 03 vũ khí đi kèm.\r\n\r\nMô hình nhân vật được làm bằng nhựa dẻo, gọn nhẹ và thanh mảnh.\r\n\r\nCó 14 Khớp có thể dễ dàng xoay theo mọi cử động.\r\n\r\nVới mô hình Ngũ Hành Vương sẽ đưa bé đến với thế giới " Anh hùng trái đất" thật mạnh mẽ và vui nhộn.\r\n\r\nSản phẩm dành cho các bé từ 3 tuổi trở lên.', 188000, '2013-06-07 23:53:48', 3, 5, 19, 49, 2),
(105, 'ĐẤT SÉT NẶN THÁI LAN 12 MÀU KHÔNG CÓ KHUÔN KID-ART', 'do-choi/Dat-set-nan-Thai-Lan-Kid-Art-1.jpg', 'Chất liệu đất sét an toàn\r\nDành cho bé 2+\r\nXuất xứ: Thái Lan', 12000, '2013-06-07 23:57:00', 23, 0, 20, 35, 1),
(106, ' THÔNG TIN SẢN PHẨM ĐỒ CHƠI THÔNG MINH RUBIK BIẾN HÌNH', 'do-choi/Do-choi-thong-minh-Rubik-bien-hinh-1.jpg', 'Chất liệu nhựa an toàn\r\nGiúp phát triển trí thông minh bé\r\nDành cho bé 3+', 18000, '2013-06-07 23:57:41', 4, 0, 20, 32, 7),
(108, 'Bộ xoay nam châm thông minh cho bé học phép tính cộng trừ nhân chia', 'do-choi/Bo-xoay-nam-cham-thong-minh-cho-be.jpg', 'Khi trẻ từ 1- 5 tuổi là đối tượng mà các bậc cha mẹ lo lắng rất nhiều và không biết dạy con bằng phương nào để trẻ không bị nhàm chán khi học mà lại rèn luyện được kĩ năng và trí thông minh của trẻ khi quan sát các sự vật hay nhận biết về con số và chữ. Chính vì điều đó mà ShopTreTho.com.vn giới thiệu cho các bậc làm cha mẹ 01 bộ sản phẩm thông minh tiện dụng giúp phát triển tài năng và trí tuệ của trẻ mà không tạo áp lực.\r\n\r\nBộ xoay nam châm thông minh dạy học Toán cho bé ra đời xuất phát từ tình yêu con trẻ thấu hiểu tâm lý và đồng hành cùng các bậc phụ huynh trong việc chăm sóc và giáo dục con em mình.\r\n\r\nVới chất liệu nhựa an toàn ép gắn nam châm, sản phẩm đạt chất lượng cao an toàn cho bé khi sử dụng.\r\n\r\nBộ sản thông minh, có tính giáo dục cao, phát triển được kỹ năng và trí tuệ cho trẻ, đặc biệt là rất an toàn đó chính là những ưu điểm dễ nhận thấy của bộ nam châm dạy học\r\n\r\nBộ nam châm dạy học - “Học mà chơi, chơi mà học” không chỉ giúp trẻ vận động mà còn rèn nhiều đức tính cần thiết ngay từ nhỏ như tính kiên nhẫn, khéo léo… và kích thích trí tưởng tượng, tìm tòi, khám phá sáng tạo, đem lại cho trẻ tâm lý thoải mái khi chơi.', 14000, '2013-06-08 00:00:26', 12, 0, 20, 47, 18),
(109, 'Đồ chơi đàn hình bò 4400', 'do-choi/do-choi-dan-hinh-bo-1.jpg.jpg', 'Thích hợp cho bé gái\r\nÂm thanh vui vẻ\r\nHình ảnh ngộ nghĩnh', 110000, '2013-06-08 01:24:31', 5, 6, 18, 44, 4),
(110, 'ĐỒ CHƠI MÈO NHẠI TIẾNG VIỆT TALKING TOM CAT LOẠI NHỎ', 'do-choi/do-choi-tailking-tom-cat-loai-nho.jpg', 'Là đồ chơi âm thanh\r\nDành cho bé 3 tuổi trở lên\r\nCó khả năng nhại giọng nói', 175000, '2013-06-08 01:25:21', 5, 1, 18, 35, 10),
(111, 'ĐỒ CHƠI GANG NAM STYLE 56566', 'do-choi/do-choi-bup-be-gang-nam-style-56566.jpg', 'Búp bê hình ca sĩ PSY\r\nCó điệu Gangnam style vui nhộn\r\nDành cho bé từ 3 tuổi trở lên', 215000, '2013-06-08 01:35:03', 6, 4, 18, 52, 1),
(112, 'Phát sáng Có âm thanh Sử dụng pin hoặc nguồn điện', 'do-choi/den-rua-ru-ngu2.jpg', 'Phát sáng\r\nCó âm thanh\r\nSử dụng pin hoặc nguồn điện', 128000, '2013-06-08 01:36:03', 1, 1, 18, 31, 13),
(113, 'ĐỒ CHƠI NHẠC "BÉ GỌI DI ĐỘNG" BF-767', 'do-choi/dien-thoai-di-dong.jpg', 'Chất liệu nhựa an toàn cho trẻ\r\nCó thể ghi âm thanh của bé\r\nÂm thanh giúp phát triển các giác quan của trẻ', 209000, '2013-06-08 01:37:50', 19, 13, 18, 32, 4),
(114, 'Hộp nhạc Music block', 'do-choi/hop-nhac-music-blocks-2.jpg', 'Hộp nhạc Music block\r\nHộp nhạc xinh xắn dành cho bé từ 2 tuổi trở lên, mỗi ô vuông khi bé nhấn vào tương ứng với âm thanh và đèn linh hoạt, tạo cảm giác thích thú cho bé.\r\n\r\nLà sản phẩm được nhập khẩu sang thị trường Châu Âu, nên rất yên tâm về chất lượng và sự an toàn của sản phẩm.', 220000, '2013-06-08 01:39:19', 6, 1, 18, 54, 16),
(115, 'ĐỒ CHƠI TREO NÔI WINFUN 0815', 'do-choi/treo-noi-winfun0815-2.jpg', 'Chất liệu nhựa cao cấp\r\nMàu sắc sặc sỡ, phát nhạc\r\nThương hiệu Mỹ', 480000, '2013-06-08 01:40:42', 3, 2, 24, 53, 21),
(117, 'CÂY HOA XÚC XẮC BKIDS', 'do-choi/Fun-Flower-High-Chair-Toy.jpg', 'Phát ra tiếng kêu vui tai mỗi khi xoay\r\nGiúp bé học làm quen với thiên nhiên\r\nTuyệt đối không chứa BPA', 320000, '2013-06-08 01:44:24', 4, 9, 21, 41, 2),
(118, 'XÚC XẮC KHỈ CON TUNG HỨNG', 'do-choi/b-kids-wacky-monkey-1.jpg', 'Nhiều tư thế vô cùng tinh nghịch\r\nTuyệt đối không chứa BPA\r\nCác hạt vòng có thể xoay vặn', 227000, '2013-06-08 01:45:24', 6, 4, 21, 35, 20),
(119, 'ĐỒ CHƠI TẮM VỊT CON DEDEE', 'do-choi/vit-con.jpg', 'Đồ chơi tắm đáng yêu\r\nVịt con Dedee có hình dáng tròn trịa, đáng yêu\r\nMàu sắc sinh động', 50000, '2013-06-08 01:46:09', 5, 1, 23, 31, 13),
(120, 'KÍNH BƠI INTEX 55602', 'do-choi/Kinh-boi-intex-55602.jpg', '<ul><li>Chất liệu nhựa cao cấp&nbsp;</li><li>Rất đáng yêu cho bé&nbsp;</li><li>Cho bé từ 3 đến 10 tuổi</li></ul>', 60000, '2013-06-08 01:46:48', 6, 2, 23, 34, 5),
(121, 'VỊT BÁO NÓNG MUNCHKIN', 'do-choi/vit-bao-nong-munchkin-1.jpg', 'Những chú vịt được nhân cách hóa thành các nhân vật giúp bé phát triển trí tưởng tượng. Thiết bị cảm biến nhiệt White Hot sẽ cho bạn biết khi nước quá nóng đối với cơ thể trẻ.\r\n\r\nKhi nước tắm cho bé vượt quá 43 độ C thì chữ HOT dưới đáy con vịt sẽ hiện lên màu trắng báo rằng nhiệt độ nước quá nóng so với da của bé.\r\n\r\nChú vịt báo nóng munchkin được lắp vào vòi nước trong nhà tắm.\r\n\r\nGiúp bạn yên tâm khi bé tắm trong bồn. Bé không chạm tay vào vòi nước nóng.\r\n\r\nVịt đút vừa với tất cả các loại vòi nước.\r\n\r\nVô cùng thú vị. Sản phẩm dành cho bé từ 0 tháng tuổi trở lên.', 18000, '2013-06-08 01:47:52', 5, 1, 23, 53, 23),
(122, 'NHÀ BÓNG TOYSBRO BOWLING TJ3316 CHO BÉ', 'do-choi/nha-bong-Toysbro-bowling-TJ3316.jpg', 'Bé tha hồ vui đùa\r\nKích thước: 112 x 96 x 70 cm\r\nChất liệu an toàn cho bé\r\n\r\nều bóng chính hãng TOYSBRO hình lục giác bao gồm cả bộ Bowling và 50 bóng chính hãng.\r\n\r\nKích thước Dài, Rộng, Cao = 112 x 96 x 70 cm.\r\n\r\nSản phẩm đạt tiêu chuẩn An Toàn về đồ chơi trẻ em GB 6675-2003 và tiêu chuẩn xuất khẩu châu Âu.\r\n\r\nĐây là một trò chơi vận động, phát huy trí tưởng tượng và óc sáng tạo của bé\r\n\r\nNhà bóng Toysbro bowling TJ3316 có hình dáng ngộ nghĩnh, màu sắc bắt mắt phù hợp với trẻ nhỏ. Xung quanh có lưới thoáng mát và dễ dàng quan sát bé. \r\n\r\nBố mẹ thả bóng vào nhà bóng cho bé chơi, nằm xoài lên các quả bóng, chơi ném bóng hay mang đồ chơi khác vào chơi.\r\n\r\nKhi chơi mệt buồn ngủ bé lăn ra ngủ luôn trong nhà bóng.\r\n\r\nNhà bóng tự bung không cần lắp đặt và có thể gập lại gọn gàng nhờ kết cấu khung dẻo', 450000, '2013-06-08 01:49:07', 20, 1, 25, 29, 16),
(123, 'XE MÁY ĐIỆN TRẺ EM LK 3010', 'do-choi/xe-may-tu-dong-3011.jpg', 'Chắc chắn và an toàn\r\nThân thiện với môi trường\r\nDành cho trẻ từ 1.5 đến 6 tuổi', 760000, '2013-06-08 01:50:03', 12, 8, 25, 49, 17),
(126, 'Lego Ninjago 2 - Bộ chiến thuyền rồng đỏ', 'do-choi/0260_1.jpg', '<span class="Apple-tab-span" style="white-space: pre;">	</span><i>Truyền thuyết kể rằng, Bí Mật Cơn Lốc Ninjago được tạo ra bởi Bậc Thấy Tuyệt Chiêu Lốc Xoáy - Spinjitzu - bằng cách sử dụng tử thần binh khí: Lưỡi Hái Địa Chấn, Nhị Khúc Côn Sấm Chớp, Phi Tiêu Băng Giá, Hỏa Trường Kiếm\r\nTử thần binh khí có sức mạnh khủng khiếp đến nỗi không ai có thể sử dụng tất cả các quyền lực của chúng cùng một lúc\r\nKhi ông qua đời, 2 đứa con trai của ông thừa kế Tử Thần Binh Khí. Nhưng người con trai lớn đã bị quyền lực bóng tối bủa vây, và cậu ta muốn đoạt tử thần binh khí cho mục đích xấu xa. Một cuộc chiến giữa anh em họ nổ ra và người anh bị đày xuống địa ngục.&nbsp;</i><div><br></div><div>Khi hòa bình, người em trai cất giấu vũ khí. Nhưng biết tham vọng quyền lực của anh trai mình không dừng lại ở đó, cậu đã sắp xếp rồng thiêng bảo vệ Tử thần binh khí, và giao tấm bản đồ cho một người đàn ông tin cậy cất giữ.&nbsp;<div><br></div><div>Người anh trai chính là chúa tể bóng tối Garmadon, Người em trai là sư phụ Wu - Truyền nhân cuối cùng của môn phái Spinjitzu và người đàn ông đáng tin cậy được giao giữ tấm bản đồ là cha của Kai - Ninja lừa.\r\nSư phụ Wu đã du ngoạn trong giang hồ để tìn ra và đào tạo 4 truyền nhân tiếp theo của môn phái Spinjitzu, sử dụng Tử Thần Binh Khí để bảo vệ hòa bình thế giới\r\n\r\nVà từ hôm nay, cuộc phiêu lưu mới bắt đầu...\r\n<br><br>\r\n<iframe width="560" height="315" src="http://www.youtube.com/embed/TBTcE_72VLM" frameborder="0" allowfullscreen=""></iframe></div></div>', 550000, '2013-06-09 10:26:39', 14, 6, 19, 40, 3),
(127, 'Đèn ru ngủ Hello Kitty', 'do-choi/den-ngu-hello-kitty-2.jpg', '<p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;"></p><ul><li>Đèn ru ngủ Hello Kitty có chế độ đèn và nhạc nhè nhẹ, đưa bé dần vào giấc ngủ ngon.</li><li>Đèn ru ngủ Hello Kitty được chứng nhận là sản phẩm an toàn cho sức khỏe của trẻ.</li><li>Sản phẩm dành cho bé từ 12 tháng tuổi trở lên.</li></ul><p></p>', 280000, '2013-06-15 19:54:02', 3, 0, 18, 47, 19),
(128, 'Hộp nhạc Music block', 'do-choi/1e6e2_hop-nhac-music-blocks-2.jpg', '<p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;"><span style="background-color: transparent; margin: 0px; padding: 0px; outline: none; font-size: larger;"><font style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">Hộp nhạc xinh xắn dành cho bé từ 2 tuổi trở lên, mỗi ô vuông khi bé nhấn vào tương ứng với âm thanh và đèn linh hoạt, tạo cảm giác thích thú cho bé</font>.<br></span></p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;"><span style="background-color: transparent; margin: 0px; padding: 0px; outline: none; font-size: larger;">Là sản phẩm được nhập khẩu sang thị trường Châu Âu, nên rất yên tâm về chất lượng và sự an toàn của sản phẩm.</span></p>', 220000, '2013-06-15 19:56:00', 1, 0, 18, 47, 6),
(129, 'ĐỒ CHƠI TRỐNG CHO BÉ', 'do-choi/d1ff1_Do-choi-trong-chobe.jpg', '<ul><li><span style="color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 1.6em;">Có nhiều màu sắc cho bé lựa chọn</span></li><li><span style="color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 1.6em;">Âm thanh phát ra vui tai</span></li><li><span style="color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 1.6em;">Dùng cho bé từ sơ sinh</span></li></ul>', 14000, '2013-06-15 19:58:14', 1, 0, 18, 52, 1),
(130, 'Chú chó Fisher Price biết hát (Đồ chơi Fisher Price)', 'do-choi/cho-biet-hat-fisher-price1.jpg', '<ul style="color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 19.1875px;"><li><span style="line-height: 1.6em;">Hình chú chó ngộ nghĩnh</span></li><li><span style="line-height: 1.6em;">Bài nhạc tiếng anh vui nhộn</span></li><li><span style="line-height: 1.6em;">Tìm hiểu các bộ phận trên cơ thể</span></li></ul><div><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Chơi trò chơi, hát những bài hát, thưởng thức rất nhiều học vui vẻ với người bạn dễ thương này.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Chú chó Puppy với hai chế độ chơi tương tác với các bài hát phổ biến ABC song, 1-2-3, màu sắc, và các bộ phận của cơ thể, cùng với các bài hát yêu thích và các trò chơi, bao gồm Itsy-Bitsy Spider, Pat-a-Cake, This Little Puppy Went to Market,Head Shoulders Knees And Toes và nhiều hơn nữa.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Bé vừa học tiếng Anh vừa chơi và ca hát hàng ngày!</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Bé yêu sẽ thích ca hát, nhảy múa và chơi với chú chó Puppy đáng yêu</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Chú chó Puppy đáng yêu giúp bé phát triển cảm giác âu yếm, yêu thương, ôm ấp và thể hiện tình bạn</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Giúp bé tìm hiểu về các bộ phận của cơ thể.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Giới thiệu và dạy bé học bảng chữ cái, màu sắc và đếm số</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Giúp con hiểu được các kết nối giữa các từ ngữ và hình ảnh</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Trái tim của chú chó phát sáng theo từng điệu nhạc, giúp con biết yêu thương và thể hiện tình yêu thương nồng nàn là như thế nào, khi có một chú chó trung thành bên con từ tấm bé</p></div>', 285000, '2013-06-15 20:00:03', 1, 0, 18, 54, 7),
(131, 'Đồ chơi Tomy 395560 - Mô hình tàu hỏa Sakura Set', 'do-choi/do-choi-tomy-thomas-395560-2.jpg', '<ul style="color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 19.1875px;"><li><span style="line-height: 1.6em;">Cho bé từ 3 tuổi trở lên</span></li><li><span style="line-height: 1.6em;">Phát triển các giác quan cho bé</span></li><li><span style="line-height: 1.6em;">Thương hiệu Nhật Bản</span></li></ul><div><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;"><strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">Đồ chơi Tomy 395560 - Mô hình tàu hỏa Sakura Set&nbsp;</strong>sẽ giúp bé yêu của bạn có những giờ phút vui chơi thú vị. Bộ gồm nhiều phụ kiện kèm theo như cây cối, trạm, cầu cho bé được trải nghiệm khung cảnh gần giống như thực tế. Qua đó, bé sẽ được phát huy trí tưởng tượng, sáng tạo và kỹ năng tư duy.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;"><strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">Chất liệu nhựa an toàn</strong></p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Sản phẩm được làm từ chất liệu nhựa an toàn, không gây hại đến sức khỏe của trẻ nhỏ. Thiết kế sản phẩm không góc cạnh, đảm bảo cho bé không bị tổn thương, trầy xước.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;"><strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">Bộ kèm theo nhiều phụ kiện</strong></p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Bộ được kèm theo nhiều mô hình cây cối, cầu, trạm dừng cho bé được trải nghiệm khung cảnh gần giống như thực tế.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;"><strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">Giúp bé phát triển trí tưởng tượng, sáng tạo</strong></p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Bằng việc theo dõi đoàn tàu đầy màu sắc di chuyển, bé sẽ được phát triển thị giác, thính giác. Đồng thời, khi lắp ráp đường ray, tổ chức vận hành cho tàu chạy,...bé sẽ được luyện kĩ năng tư duy, phát huy trí tưởng tượng, sáng tạo cần thiết cho việc học của bé sau này.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;">Sản phẩm dùng kèm pin.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px;"><strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">Takara Tomy</strong>&nbsp;là tập đoàn chuyên sản xuất đồ chơi nổi tiếng của Nhật Bản. Thành lập từ năm 1970, Takara Tomy luôn mang đến cho trẻ em Nhật Bản những mô hình tàu, xe,…nhằm giúp các em phát huy trí tưởng tượng, sáng tạo, và biết ước mơ.</p></div>', 595000, '2013-06-15 20:01:42', 0, 0, 19, 40, 17),
(132, 'Đồ chơi SIKU 1337- Porsche Turbo Cabrio', 'do-choi/porsche-911-turbo-convertible-1337.jpg', '<p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;"><strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">Tuyệt đối an toàn</strong></p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;">Thiết kế chắc chắn nhưng không hề góc cạnh. Chất liệu nhựa cao cấp tuyệt đối an toàn cho bé, hoàn toàn không độc hại.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;"><strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">Tính giải trí cao</strong></p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;">Từ đường nét chi tiết, nước sơn đến mẫu thiết kế trên xe đều thu hút được sự chú ý của bé, giúp bé có thể tận hưởng những giây phút giải trí tuyệt vời nhất.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;"><strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">Tăng khả năng học hỏi</strong></p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;">Mô phỏng một cách tinh xảo và chính xác với hình ảnh xe thật theo tỉ lệ chính xác tuyệt đối giúp bé dễ dàng phân biệt &amp; học hỏi về các phương tiện giao thông.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;">Các bé trai sẽ thích mê siêu xe thể thao của Siku. Chất liệu cao cấp, các chi tiết tinh xảo, sản phẩm trông không khác gì xe thật. Hãy khẳng định bản lĩnh của mình trên đường đua và trở thành ông vua tốc độ nhé các bạn nhỏ.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;">Những chiếc mô hình lúc nào cũng có một sức hút mãnh liệt đối với các bé trong độ tuổi khám phá.&nbsp;<strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">Đồ chơi cho bé SIKU 1337&nbsp;</strong>có thiết kế như thật với những đường nét mô phỏng tinh tế từng chi tiết sẽ thỏa mãn những cậu bé đầy trí tò mò. Mô hình Siku với kích cỡ nhỏ nhắn sẽ trở thành một món sưu tập có ý nghĩa và là một người bạn thân thiết đi theo bé mọi lúc mọi nơi.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;"><strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">CÁCH CHƠI:&nbsp;</strong>Với&nbsp;<a href="http://www.shoptretho.com.vn/Do-Choi-Cho-Be-Category-l1-c28-p1.aspx" style="background-color: transparent; margin: 0px; padding: 0px; outline: rgb(0, 0, 0); color: rgb(0, 98, 183); text-decoration: none;"></a><a href="http://www.shoptretho.com.vn/Do-Choi-Cho-Be-Category-l1-c28-p1.aspx" style="background-color: transparent; margin: 0px; padding: 0px; outline: rgb(0, 0, 0); color: rgb(0, 98, 183); text-decoration: none;">đồ chơi cho bé</a>&nbsp;SIKU 1337 Bé có thể dùng lực đẩy cho xe chuyển động hoặc dùng xe như một món đồ sưu tập.</p>', 89000, '2013-06-15 20:02:46', 1, 0, 19, 53, 13),
(133, 'Đồ chơi cho bé Siku 1318 – Mô hình Lamborghini Murciélago', 'do-choi/do choi cho be siku 1318.jpg', '<p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;"><span style="background-color: transparent; margin: 0px; padding: 0px; outline: none; font-size: 18px;">ĐẶC ĐIỂM NỔI BẬT</span></p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;"><strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">Tuyệt đối an toàn</strong></p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;">Thiết kế chắc chắn nhưng không hề góc cạnh. Chất liệu nhựa cao cấp tuyệt đối an toàn cho bé, hoàn toàn không độc hại.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;"><strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">Tính giải trí cao</strong></p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;">Từ đường nét chi tiết, nước sơn đến mẫu thiết kế trên xe đều thu hút được sự chú ý của bé, giúp bé có thể tận hưởng những giây phút giải trí tuyệt vời nhất.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;"><strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">Tăng khả năng học hỏi</strong></p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;">Mô phỏng một cách tinh xảo và chính xác với hình ảnh xe thật theo tỉ lệ chính xác tuyệt đối giúp bé dễ dàng phân biệt &amp; học hỏi về các phương tiện giao thông.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;">Các bé trai sẽ thích mê siêu xe thể thao của Siku. Chất liệu cao cấp, các chi tiết tinh xảo, sản phẩm trông không khác gì xe thật. Hãy khẳng định bản lĩnh của mình trên đường đua và trở thành ông vua tốc độ nhé các bạn nhỏ.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;">Những chiếc mô hình lúc nào cũng có một sức hút mãnh liệt đối với các bé trong độ tuổi khám phá.<strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">&nbsp;</strong><strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">Đồ chơi cho bé Siku 1318 – Mô hình Lamborghini Murciélago</strong>&nbsp;có thiết kế như thật với những đường nét mô phỏng tinh tế từng chi tiết sẽ thỏa mãn những cậu bé đầy trí tò mò. Mô hình Siku với kích cỡ nhỏ nhắn sẽ trở thành một món sưu tập có ý nghĩa và là một người bạn thân thiết đi theo bé mọi lúc mọi nơi.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;"><strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">CÁCH CHƠI:&nbsp;</strong>Với&nbsp;<strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;"><a href="http://www.shoptretho.com.vn/Do-Choi-Cho-Be-Category-l1-c28-p1.aspx" style="background-color: transparent; margin: 0px; padding: 0px; outline: rgb(0, 0, 0); color: rgb(0, 98, 183); text-decoration: none;"></a><a href="http://www.shoptretho.com.vn/Do-Choi-Cho-Be-Category-l1-c28-p1.aspx" style="background-color: transparent; margin: 0px; padding: 0px; outline: rgb(0, 0, 0); color: rgb(0, 98, 183); text-decoration: none;">đồ chơi cho bé</a>&nbsp;SIKU 1318</strong>&nbsp;Bé có thể dùng lực đẩy cho xe chuyển động hoặc dùng xe như một món đồ sưu tập.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;">---------------------------------------------------------</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;"><strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">Siku</strong>, một nhãn hiệu sản xuất xe đồ chơi uy tín và nổi tiếng của Đức luôn được khách hàng săn đón bởi những thiết kế gần gũi với cuộc sống, không chỉ hấp dẫn trẻ em mà còn lôi cuốn cả những người thích sưu tầm. Được thành lập năm 1921, với sự đầu tư về kĩ thuật cũng như chất lượng không ngừng, Siku đã cho ra đời hơn 350 mô hình đồ chơi các loại với mẫu mã đẹp và độ an toàn cao cho người tiêu dùng. Từ dòng sản phẩm xe đồ chơi giản đơn cho đến dòng sản phẩm xe đồ chơi điểu khiển từ xa hiện đại, Siku ưu tiên chỉ sử dụng vật liệu nhựa cao cấp để đưa vào sản xuất, không gây dị ứng da cho trẻ nhỏ nên bố mẹ có thể yên tâm khi cho bé vui chơi cùng xe đồ chơi của Siku.</p>', 102000, '2013-06-15 20:03:52', 3, 0, 19, 53, 7),
(134, 'Đồ chơi phi tiêu bằng gỗ 2 mặt', 'do-choi/do-choi-phi-tieu-bang-go.jpg', '<ul style="color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 19.1875px;"><li><span style="line-height: 1.6em;">Gồm có 2 mặt</span></li><li><span style="line-height: 1.6em;">Có 6 phi tiêu đi kèm</span></li><li><span style="line-height: 1.6em;">Chất liệu gỗ bền đẹp</span></li></ul><div><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;"><strong style="background-color: transparent; margin: 0px; padding: 0px; outline: none;">Phi tiêu</strong>&nbsp;là môn thể thao để tập luyện và thi đấu nhẹ nhàng, vui vẻ nhưng cũng rất thú vị đang trở thành một phong trào mới tại Việt Nam.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;">Thật tuyệt vời nếu bạn đang tìm một môn thể thao dễ tiếp cận để tập luyện, nâng cao sức khỏe cho mọi lứa tuổi, giảm xì-trét và đặc biệt có thể chơi trong mọi không gian dù ở nơi làm việc hay trong gia đình và không đỏi hỏi đầu tư nhiều.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;">1 bộ phi tiêu có sẵn 6 phi tiêu đi kèm để mở rộng cho trò chơi của bạn được thỏai mái và tiện lợi hơn.</p><p style="background-color: rgb(255, 255, 255); margin: 10px 0px 15px; padding: 0px; outline: none; color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 13px; text-align: justify;">Bạn an tâm đi với bộ phi tiêu này sẽ làm cho bạn bớt đi rất nhiều căng thẳng sau nhũng ngày làm việc, hoặc bạn cũng có thể sắm cho mình một cái tại phòng làm việc của cơ quan bạn giải trí bất cứ khi nào bạn cảm thấy căng thẳng.</p></div>', 115000, '2013-06-15 20:06:01', 0, 0, 25, 41, 4),
(135, 'Chất liệu nilong Hình ảnh màu sắc ngộ nghĩnh Dùng trang trí căn phòng cho bé', 'do-choi/tranh-dan-dautay.jpg', '<ul><li><span style="color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 1.6em;">Chất liệu nilong</span></li><li><span style="color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 1.6em;">Hình ảnh màu sắc ngộ nghĩnh</span></li><li><span style="color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 1.6em;">Dùng trang trí căn phòng cho bé</span></li></ul>', 16000, '2013-06-15 20:09:14', 2, 1, 27, 33, 19);
