(29, 'Autoru', 'nha-san-xuat/Autoru.png', '', '2013-05-04 07:58:09'),
(31, 'Bright Starts', 'nha-san-xuat/BrightStartsLogo_1.jpg', '', '2013-06-03 08:01:03'),
(32, 'Canpol', 'nha-san-xuat/canpol.jpg', '<h1>Giới thiệu về: Lovi Canpol</h1>\r\n\r\n<b>Kính gửi Quý phụ huynh!</b>\r\n\r\nHiện nay có nhiều ý kiến khác nhau về chất hóa học BPA có trong sản phẩm dùng để cho trẻ ăn. Chúng tôi đảm bảo rằng sản phẩm LOVI được sản xuất từ các nguyên liệu tuyệt đối an toàn, tuân thủ các tiêu chuẩn nghiêm ngặt liên quan đến BPA do nước Cộng hòa Ba Lan và Ủy ban Châu Âu quản lý.\r\n\r\nHơn nữa, chúng tôi xin nhấn mạnh rằng các dụng cụ cho trẻ ăn mang nhãn hiệu LOVI thường xuyên được kiểm tra, từ các sản phẩm dạng polycarbonat đến các nguyên liệu thô (như polypropylene, silicone). Kết quả thử nghiệm đảm bảo rằng các sản phẩm tuyệt đối an toàn với hàm lượng BPA (trong sản phẩm dạng polycarbonate) thấp hơn tiêu chuẩn của Ủy ban Châu Âu.\r\n\r\nĐể đáp ứng nhu cầu của người mua, chúng tôi đã quyết định giới thiệu một chất liệu thô tương đương không có BPA để thay thế polycarbonate. Hiện nay, khách hàng đã có lựa chọn loại chất liệu cho cùng một sản phẩm: từ polycarbonate hoặc chất liệu khác tương đương không có BPA (BPA 0%).', '2013-06-03 08:01:20'),
(33, 'Chicco', 'nha-san-xuat/Chicco.jpg', '<b>Tập đoàn Artsana có uy tín rất lớn về dịch vụ toàn cầu, được khách hàng biết đến qua hai thương hiệu chính: Chicco, từ 40 năm nay, chuyên nghiên cứu và thử nghiệm các sản phẩm cho trẻ sơ sinh và trẻ đang trong thời kì bú mẹ; và Prénatal, một thương hiệu được gây dựng từ năm 1995, chuyên lựa chọn và phân phối các sản phẩm tốt nhất về bà mẹ và trẻ em.</b>\r\n\r\nChicco là một nhãn hiệu “mang tính lịch sử” của tập đoàn Artsana. Kể từ năm 1997, tập đoàn này đã đề ra những chuẩn mực đạo đức cho không chỉ các công ty của mình mà còn cho tất cả các nhà cung cấp trên toàn thế giới của tập đoàn đó.\r\n\r\nChuẩn mực này được đặt ra trên cơ sở thực hiện những cam kết đã kí giữa tập đoàn và các tổ chức công đoàn ở Italia, bao gồm những nguyên tắc cơ bản về các mối quan hệ và điều kiện làm việc, đặc biệt là những vấn đề liên quan đến lao động trẻ em, lao động nặng nhọc, mức lương, các khoản trợ cấp, lợi ích, giờ làm việc, sức khoẻ và an toàn công việc, phân biệt chủng tộc, và công đoàn.\r\n\r\nNhững chuẩn  mực này đã thể hiện được thái độ cũng như sự lựa chọn chiến lược của tập đoàn trong việc thiết lập và duy trì những mối quan hệ công việc với các nhà cung cấp.\r\n\r\nSứ mệnh Chicco:\r\n\r\nChúng tôi hướng tới xây dựng một thương hiệu đáp ứng tốt nhất nhu cầu của trẻ em trên toàn thế giới. Chicco là nhà cung cấp đáng tin cậy các sản phẩm trẻ em tiện dụng, đơn giản, và an toàn, được thiết kế đặc biệt phù hợp với từng giai đoạn phát triển của trẻ. Mỗi một sản phẩm ra đời là sự kết tinh của tài năng, tình yêu, trách nhiệm và cam kết nhằm giúp trẻ phát triển một cách tốt nhất.\r\n\r\nTrong nhiều năm qua, dòng sản phẩm trẻ em của Chicco luôn hướng đến một mục tiêu đơn giản nhưng lai rất khó thực hiện: đó là “chăm sóc cho trẻ và môi trường xung quanh trẻ từ khi mới sinh cho đến tuổi dậy thì”. Chính nhờ đó mà Chicco đã trở thành chuyên gia hàng đầu về chăm sóc và cung cấp đồ dùng trẻ em và là người tư vấn đáng tin cậy cho các bậc cha mẹ để cho họ có thể hoàn thành tốt hơn thiên chức của mình.', '2013-05-03 08:01:42'),
(34, 'Combi', 'nha-san-xuat/1365690135771163598.jpg', 'Hơn 50 năm kinh nghiệm\r\n\r\n\r\n\r\nCombi là một trong những nhà sản xuất đồ dùng trẻ em Nhật Bản lớn nhất thế giới hiện nay có lịch sử phát triển từ năm 1957.\r\n\r\n\r\n\r\nThiết kế và cải tiến đến từ Nhật Bản\r\n\r\n\r\n\r\nMọi người đều biết rằng người Nhật tạo ra sản phẩm có chất lượng và tính cải tiến rất cao. Chất lượng và tính cải tiến của các sản phẩm Combi đến từ một công ty Nhật đáp ứng những mong muốn đó của người tiêu dùng.\r\n\r\n\r\n\r\nĐơn giản và tiện nghi\r\n\r\n\r\n\r\nChúng tôi biết rằng việc chăm sóc em bé đòi hỏi mọi sản phẩm được thiết kế và sản xuất đều phải làm cho việc nuôi nấng trẻ em trở nên dễ dàng hơn đối với bạn.\r\n\r\n\r\nAn toàn\r\n\r\n\r\n\r\nTất cả các sản phẩm Combi đều phải trải qua rất nhiều bước kiểm thử nội bộ và độc lập để bảo đảm đáp ứng các chuẩn mực quốc tế và địa phương cũng như các qui chuẩn an toàn của Combi.\r\n\r\n\r\nCao cấp\r\n\r\n\r\n\r\nChỉ những chất liệu cao cấp nhất mới được sử dụng để sản xuất các sản phẩm dành cho trẻ em của Combi\r\n\r\n\r\nTin cậy\r\n\r\n\r\n\r\nCombi là một trong những nhà sản xuất đồ trẻ em có thương hiệu còn sở hữu và điều hành chính các nhà máy sản xuất của mình. Hầu hết những nhà sản xuất nhận linh kiện từ nơi khác đều thất bại trong việc kiểm soát chất lượng cũng như khả năng cải tiến và thiết kế các sản phẩm mới.\r\n\r\n\r\n\r\nNhãn hàng Com bi chân thành gửi tới các bậc cha mẹ 3 lời hứa: tầm nhìn, sứ mệnh và giá trị', '2013-05-03 08:01:42'),
(35, 'Disney', 'nha-san-xuat/Disney.jpg', '', '2013-05-03 08:01:42'),
(37, 'Fisher Price', 'nha-san-xuat/fisher-price-logo.png', '', '2013-05-03 08:01:42'),
(40, 'LEGO', 'nha-san-xuat/55518_lego.jpg', 'Thương hiệu LEGO được hình thành bởi những tình cảm mà mọi người mong đợi từ công ty – về sản phẩm và dịch vụ. Thương hiệu hoạt động như một sự đảm bảo chất lượng và truyền thống. Trẻ em là những đối tượng tiêu biểu của LEGO Group – có óc tò mò, sáng tạo và trí tưởng tượng – với một sự ham muốn học hỏi bẩm sinh. LEGO Group xem chất lượng là tầm quan trọng chủ chốt, và đang cố gắng trở thành một hãng tốt nhất và đáng tin cậy nhất trong ngành kinh doanh đồ chơi.\r\n \r\nTriết lý của LEGO là “cách chơi tốt” làm phong phú cuộc sống của trẻ em – và thời trưởng thành sau này của chúng. Giữ điều này trong tâm trí, lĩnh vực rộng rãi của sản phẩm LEGO Group được tìm thấy ở triết lý cơ bản của sự học hỏi và phát triển – thông qua sự vui chơi.\r\n<br><br>\r\n<iframe width="420" height="315" src="http://www.youtube.com/embed/8FAt7ze-QLQ" frameborder="0" allowfullscreen></iframe>', '2013-05-03 08:01:42'),
(41, 'Little Tikes', 'nha-san-xuat/Little Tikes.jpg', '', '2013-05-03 08:01:42'),
(42, 'Long Hưng', 'nha-san-xuat/long hung.jpg', '', '2013-05-03 08:01:42'),
(44, 'Nano mumybear', 'nha-san-xuat/Nano mumybear.jpg', ' Mummybear  (Nano - Hàn Quốc) – Thương hiệu đồ sơ sinh an toàn, chất lượng dành cho trẻ em\r\n\r\nLần đầu tiên tại Việt Nam các sản phẩm bình sữa, ca uống nước, núm ti Nano Silver… của Mummybear được Bộ Y tế, Viện Dinh dưỡng, Cục An toàn Vệ sinh Thực phẩm, Vinacontrol …cấp chứng nhận tiêu chuẩn sản phẩm về chất lượng, vệ sinh, an toàn thực phẩm. Đến nay, thương hiệu Mummybear đã lớn mạnh, các sản phẩm của Mummybear đã có mặt ở hầu hết các siêu thị, cửa hàng, baby shop, hiệu thuốc… trên toàn quốc.', '2013-05-03 08:01:42'),
(46, 'Ngọc Anh', 'nha-san-xuat/ngocanh.JPG', '', '2013-05-03 08:01:42'),
(47, 'Nuk', 'nha-san-xuat/Nuk.jpg', '', '2013-05-03 08:01:42'),
(49, 'Playgro', 'nha-san-xuat/Playgro.jpg', '', '2013-05-03 08:01:42'),
(52, 'Shop Trẻ Thơ', 'nha-san-xuat/shop_tre_tho.png', '', '2013-05-03 08:01:42'),
(53, 'Siku', 'nha-san-xuat/siku.jpg', 'Giới thiệu về: Siku\r\n\r\nSiku, một nhãn hiệu sản xuất xe đồ chơi uy tín và nổi tiếng của Đức luôn được khách hàng săn đón bởi những thiết kế gần gũi với cuộc sống, không chỉ hấp dẫn trẻ em mà còn lôi cuốn cả những người thích sưu tầm.\r\n\r\nĐược thành lập năm 1921, với sự đầu tư về kĩ thuật cũng như chất lượng không ngừng, Siku đã cho ra đời hơn 350 mô hình đồ chơi các loại với mẫu mã đẹp và độ an toàn cao cho người tiêu dùng.\r\n\r\nTừ dòng sản phẩm xe đồ chơi giản đơn cho đến dòng sản phẩm xe đồ chơi điểu khiển từ xa hiện đại, Siku ưu tiên chỉ sử dụng vật liệu nhựa cao cấp để đưa vào sản xuất, không gây dị ứng da cho trẻ nhỏ nên bố mẹ có thể yên tâm khi cho bé vui chơi cùng xe đồ chơi của Siku.\r\n\r\nTags: Siku, thương hiệu Siku, đồ chơi Siku, thương hiệu đồ chơi Siku', '2013-05-03 08:01:42'),
(54, 'The First Year', 'nha-san-xuat/The First Year.jpg', 'The First Year là thương hiệu đồ sơ sinh của Mỹ chuyên cung cấp những sản phẩm chăm sóc sức khỏe cho em bé như: Giá úp bình sữa, nhiệt kế, bấm móng tay, cây cọ rửa bình sữa, hút mũi...Với chất lượng tốt, an toàn cho sức khỏe của bé (đặc biệt là đối với trẻ sơ sinh).\r\n\r\nMột số sản phẩm nổi bật của thương hiệu The First Year đang được bán tại Shop Trẻ Thơ như:\r\n\r\nGiá úp bình sữa The First Years\r\n\r\nNhiệt kế the first years Y7078\r\n\r\nHút mũi The First Year\r\n\r\nBấm móng tay kính lúp The First Years\r\n\r\nKhăn chườm hạ nhiệt the first years Y7063\r\n\r\nCây cọ rửa bình sữa The First Years Y1108\r\n\r\nBàn chải đánh răng The First Years Y7066', '2013-04-30 08:01:38'),
(57, 'Veesano', 'nha-san-xuat/veesano.jpg', '<ul><li>CÔNG TY CỔ PHẦN VEESANO\r\n\r\nShowroom HN: 33A&nbsp;</li><li>Trần Hưng Đạo, Hoàn Kiếm, HN\r\nTel: 04 3828 6050 |</li><li>&nbsp;Fax: 04 3928 9376 |&nbsp;</li><li>Hotline: 0904 55 43 44 \r\nShowroom HCM: 117A Cộng Hòa, P12, Tân Bình, TP.HCM\r\nTel: 08 38113378 |&nbsp;</li><li>Fax: 08 3811 2348 |</li><li>Hotline: 0902 60 64 68\r\nXưởng sản xuất: Xã Đông Thạnh, Hóc Môn, TP.HCM</li></ul>', '2013-06-04 08:01:35'),
(59, 'Winwin Toys', 'nha-san-xuat/winwintoys.jpg', '<b>Sản phẩm Winwintoys luôn bảo đảm an toàn, mang tính giáo dục, giúp kích thích sự sáng tạo và phát triển trí tuệ cho trẻ. \r\nĐược thành lập từ năm 1991,</b>&nbsp;<div>Đức Thành tự hào là một trong những Công ty hàng đầu trong ngành chế biến gỗ tại Việt Nam với 2 Nhà máy ở TP.HCM và Bình Dương. Với gần 20 năm kinh nghiệm, với đội ngũ Công nhân tay nghề cao, với dây chuyền máy móc hiện đại, mẫu mã đa dạng phong phú, đồ chơi bằng gỗ Winwintoys đã được cấp chứng nhận dấu CE (an toàn theo tiêu chuẩn châu Âu), chứng nhận hợp quy CR (theo quy chuẩn Việt Nam) điều này cũng chứng minh rằng Công ty luôn chú trọng đến việc bảo vệ sức khỏe, an toàn cho người tiêu dùng và đặc biệt là bảo vệ môi trường chung.</div>', '2013-06-03 08:01:31');
